
/* Smart Sticker (Float Image + CTA) — 2025
 * Вид: квадратная картинка (можно data:base64), крестик сверху, узкая оранжевая кнопка снизу.
 * Один файл (CSS+HTML+JS). Без data-*.
 * <script src="smart-orderbar.js" defer></script>
 */
(function (win, doc) {
  // ===== CONFIG (правь здесь) =====
  const CONFIG = {
    // в CONFIG:
formSelector: '#order-form0, .order_block form, .order-form form, form.order_form, form.intlTelInput, form[action*="api.php"]', // твой селектор(ы) формы (можно список через запятую)
    delayMs: 1000,
    dismissHours: 24,
    side: 'right',          // 'right' | 'left'
    pos: 'middle',          // 'middle' | 'bottom' (на мобиле будет bottom)
    offset: 12,
    size: 95,               // сторона картинки (px)
    radius: 16,
    shadow: '0 10px 24px rgba(0,0,0,.28)',
    image: {
      // ВСТАВЬ сюда свою картинку в base64 (или оставь пусто — будет плейсхолдер):
      // пример: data:image/webp;base64,UklGRiAAAABXRUJQVlA4IBIAAAAvAAAA...
      dataUrl: 'data:image/png;base64,',
      alt: 'Offer'
    },
    storageKey: 'smart_sticker_float_until'
  };

  // ===== i18n для текста на кнопке =====
  const CTA = {
    en:'Order now', uk:'Оформити', ru:'Оформить', es:'Pedir ahora', it:'Ordina ora',
    de:'Jetzt bestellen', fr:'Commander', pt:'Pedir agora', tr:'Şimdi sipariş ver',
    ro:'Comandă acum', hu:'Rendelek', pl:'Zamów teraz', bg:'Поръчай сега'
  };

  // ===== УТИЛИТЫ =====
  const isVisible = (el) => !!(el && (el.offsetWidth || el.offsetHeight || el.getClientRects().length));

  const waitFor = (pred, timeout = 10000, step = 120) => new Promise(res => {
    const t0 = Date.now();
    const id = setInterval(() => {
      if (pred() || Date.now() - t0 > timeout) { clearInterval(id); res(); }
    }, step);
  });

  // Собираем кандидатов форм (в т.ч. контейнеры-обёртки)
  const collectFormCandidates = () => {
    const set = new Set();
    // приоритет — явные <form>
    Array.from(document.forms).forEach(f => set.add(f));

    // частые алиасы/обёртки
    const aliasSel = [
      '[role="form"]',
      '.order_form', '.order-form', '.orderForm',
      '.order-block', '.order_block',
      '.form', '.Form', '.lead-form', '.checkout',
      '#order-form', '[id^="order-form"]', '[id*="order"]'
    ].join(',');
    document.querySelectorAll(aliasSel).forEach(el => {
      if (el.tagName !== 'FORM') {
        const inner = el.querySelector('form') || el;
        set.add(inner);
      } else {
        set.add(el);
      }
    });

    // кастомный селектор пользователя
    if (CONFIG.formSelector) {
      doc.querySelectorAll(CONFIG.formSelector).forEach(el => {
        if (el.tagName !== 'FORM') {
          const inner = el.querySelector('form') || el;
          set.add(inner);
        } else {
          set.add(el);
        }
      });
    }

    return Array.from(set);
  };

  const scoreForm = (el) => {
    if (!el) return -1;
    const root = el.tagName === 'FORM' ? el : el.querySelector('form') || el;
    let s = 0;
    const q = (sel) => root.querySelector(sel);

    // типичные поля
    if (q('input[name*="name" i], input[placeholder*="name" i]')) s += 2;
    if (q('input[type="tel"], input[name*="phone" i], input[placeholder*="phone" i]')) s += 3;
    if (q('button[type="submit"], input[type="submit"]')) s += 2;

    // популярные классы/айди
    if (/(^|\s)(order[_-]?form|intlTelInput)\b/i.test(root.className)) s += 2;
    if (/order[_-]?form/i.test(root.id)) s += 2;

    // action
    if (root.action && /(api|send|submit)\.php/i.test(root.action)) s += 1;

    // видимость
    if (isVisible(root)) s += 2;

    // находится в блоке .order_block
    if (root.closest('.order_block, .order-block')) s += 1;

    return s;
  };

  const findBestForm = () => {
    const forms = collectFormCandidates();
    forms.sort((a,b) => scoreForm(b) - scoreForm(a));
    return forms[0] || null;
  };

  // Пытаемся «раскрыть» спрятанные формы (попап/двери/квесты)
  const revealFormIfHidden = async () => {
    const block = document.querySelector('.order_block, .order-block');
    if (block && isVisible(block)) return;

    // 1) (disabled) родная функция лендинга с «дверями» — не открываем двери автоматически
    // if (typeof win.spin === 'function' && win.isOpenDoor === false) {
    //   try { win.spin(); } catch {}
    // }

    // 2) частые кнопки-открыватели
    const openers = [
      '.show-form', '.btn-show-form', '.js-show-form',
      '.pop-up-button', '.popup .ok', '[scroll-to]', '[data-scroll-to]',
      '.start-order', '.cta', '.cta-button'
    ];
    for (const sel of openers) {
      const btn = doc.querySelector(sel);
      if (btn) {
        try { btn.dispatchEvent(new MouseEvent('click', {bubbles:true})); } catch {}
      }
    }

  // 3) (disabled) «двери» — не кликаем автоматически по элементам дверей
  // const door = doc.querySelector('.door, .door__1, #door__1');
  // if (door) { try { door.dispatchEvent(new MouseEvent('click', {bubbles:true})); } catch {} }

    // ждём появления блока заказа или видимой формы
    await waitFor(() => {
      const f = findBestForm();
      return (block && isVisible(block)) || (f && isVisible(f));
    }, 9000);
  };

  // Мягкий скролл к форме/якорю
  const smoothScrollToForm = () => {
    // Scroll ONLY to the explicit anchor #goToForm
    const target = doc.getElementById('goToForm');
    if (!target) return;
    try { target.scrollIntoView({ behavior: 'smooth', block: 'start' }); }
    catch { location.hash = '#goToForm'; }
  };

  // Авто-подгон текста CTA: переносы + сжатие шрифта (до 12px) в пределах 2 строк
  const fitCtaText = (btn) => {
    if (!btn) return;
    const maxLines = 2;
    const minFont = 12;
    const getLineHeight = () => {
      const cs = getComputedStyle(btn);
      const lh = parseFloat(cs.lineHeight);
      const fs = parseFloat(cs.fontSize);
      return isNaN(lh) ? 1.15 * fs : lh;
    };

    // переносы/дефисы
    btn.style.whiteSpace = 'normal';
    btn.style.wordBreak = 'break-word';
    btn.style.overflowWrap = 'anywhere';
    btn.style.hyphens = 'auto';
    btn.style.textAlign = 'center';

    const lh = getLineHeight();
    const maxH = lh * maxLines + 2; // небольшой люфт
    let fs = parseFloat(getComputedStyle(btn).fontSize) || 14;

    const fits = () => btn.scrollHeight <= maxH && btn.scrollWidth <= (btn.clientWidth + 1);

    // если не влезает — понижаем шрифт до минимума
    let guard = 12;
    while (!fits() && fs > minFont && guard--) {
      fs -= 1;
      btn.style.fontSize = fs + 'px';
    }
    // если всё равно не влезает по ширине — позволяем увеличиться по высоте (до 2 строк уже учтено maxH)
    // кнопку не обрезаем, допускаем лёгкий рост высоты
  };

  // ===== ОСНОВНОЙ API =====
  const API = {
    _injected:false,
    init(){
      if (this._injected) return; this._injected = true;

      // уважаем закрытие
      const until = +localStorage.getItem(CONFIG.storageKey) || 0;
      if (Date.now() < until) return;

      const lang = (doc.documentElement.lang || (navigator.language||'en'))
                    .slice(0,2).toLowerCase();
      const ctaText = CTA[lang] || CTA.en;

      this._injectCSS();
      const el = this._create(ctaText);

      const btn   = el.querySelector('[data-cta]');
      const imgW  = el.querySelector('.sf__imgwrap');
      const close = el.querySelector('[data-close]');

      const onClick = async (e) => {
        e.preventDefault();
        await revealFormIfHidden();
        smoothScrollToForm();
      };

      btn.addEventListener('click', onClick);
      imgW.addEventListener('click', async (e)=>{ if (!e.target.closest('[data-close]')) { await onClick(e); } });

      close.addEventListener('click', (e)=>{
        e.stopPropagation();
        el.remove();
        localStorage.setItem(CONFIG.storageKey, String(Date.now() + CONFIG.dismissHours*3600*1000));
      });

      const activate = () => {
        const form = findBestForm() || doc.querySelector(CONFIG.formSelector) || doc.querySelector('form');
        if (!form) { el.classList.add('sf--visible'); return; }
        if ('IntersectionObserver' in window){
          const io = new IntersectionObserver(([entry])=>{
            const visible = entry.isIntersecting;
            el.classList.toggle('sf--visible', !visible);
            el.setAttribute('aria-hidden', visible ? 'true' : 'false');
          }, {threshold:0.2});
          io.observe(form);

          const r = form.getBoundingClientRect();
          const inView = r.top < window.innerHeight && r.bottom > 0;
          el.classList.toggle('sf--visible', !inView);
          el.setAttribute('aria-hidden', inView ? 'true' : 'false');
        } else {
          el.classList.add('sf--visible');
        }

        // финальный фитинг текста CTA
        fitCtaText(btn);
        // на изменение размеров окна — ещё раз
        win.addEventListener('resize', () => fitCtaText(btn), { passive:true });
      };

      setTimeout(activate, Math.max(0, CONFIG.delayMs));
    },

    _injectCSS(){
      const sideDecl = CONFIG.side === 'left'
        ? `left:${CONFIG.offset}px; right:auto;`
        : `right:${CONFIG.offset}px; left:auto;`;

      const posDecl = CONFIG.pos === 'bottom'
        ? `bottom:${CONFIG.offset + 8}px; top:auto; transform:none;`
        : `top:50%; transform:translateY(-50%);`;

      const css = `
:root{
  --sf-size:${CONFIG.size}px;
  --sf-radius:${CONFIG.radius}px;
  --sf-shadow:${CONFIG.shadow};
  --sf-offset:${CONFIG.offset}px;
  --sf-pill:14px; /* радиус таблетки кнопки */
}
.sf{
  position:fixed; ${sideDecl} ${posDecl};
  z-index:100000;
  width:var(--sf-size);
  max-width:calc(100dvw - ${CONFIG.offset*2 + 16}px);
  display:flex; flex-direction:column; align-items:center; gap:8px;
  pointer-events:none; opacity:0; transition:opacity .2s ease;
}
.sf--visible{ opacity:1; pointer-events:auto; }

.sf__imgwrap{
  width:100%; aspect-ratio:1/1;
  border-radius:var(--sf-radius);
  overflow:hidden; position:relative;
  box-shadow:var(--sf-shadow);
  display:grid; place-items:center;
  background:linear-gradient(145deg,#98b6ff,#22c55e); /* видно, если нет картинки */
  cursor:pointer;
}
.sf__img{ width:100%; height:100%; object-fit:cover; display:block; }

/* крестик поверх картинки */
.sf__x{
  position:absolute; top:6px; ${CONFIG.side==='left'?'right':'left'}:6px;
  width:24px; height:24px; border:0; border-radius:50%;
  background:rgba(0,0,0,.55); color:#fff; display:grid; place-items:center;
  font-size:14px; line-height:1; cursor:pointer;
}

/* ОРАНЖЕВАЯ кнопка (узкая, с переносами до 2 строк) */
.sf__cta{
  max-width:calc(100% - 10px);
  align-self:center;
  display:inline-block;
  background:linear-gradient(180deg,#FFB23A,#FF8A00);
  color:#111827;
  border:0; border-radius:var(--sf-pill);
  padding:6px 10px;
  font-weight:500;
  font-size:14px;                /* базовый — дальше автоподгон JS */
  line-height:1.15;
  letter-spacing:.1px;
  cursor:pointer;
  box-shadow:0 6px 14px rgba(255,138,0,.32);

  /* переносы/дефисы/центрирование — чтобы длинные языки влезали красиво */
  white-space:normal;
  word-break:break-word;
  overflow-wrap:anywhere;
  hyphens:auto;
  text-align:center;
}

/* мобильный вид: низ экрана */
@media (max-width: 480px){
  .sf{ top:auto; bottom:${CONFIG.offset + 8}px; transform:none; }
}

/* iOS safe area */
@supports(padding:max(0px)){
  .sf{ padding-bottom:max(0px, env(safe-area-inset-bottom)); }
}

/* reduce motion */
@media (prefers-reduced-motion: reduce){
  .sf{ transition:none; }
}
      `.trim();

      const style = doc.createElement('style');
      style.setAttribute('data-smart-sticker-float','');
      style.textContent = css;
      doc.head.appendChild(style);
    },

    _create(ctaText){
      const root = doc.createElement('div');
      root.className = 'sf';
      root.id = 'smart-sticker-float';
      root.setAttribute('aria-hidden','true');

      // картинка: base64 data URL или встроенный SVG-плейсхолдер
      const imgBlock = CONFIG.image.dataUrl
        ? `<img class="sf__img" src="${CONFIG.image.dataUrl}" alt="${CONFIG.image.alt||''}" loading="lazy">`
        : `<svg class="sf__img" viewBox="0 0 100 100" aria-hidden="true">
             <defs>
               <linearGradient id="g" x1="0" x2="1" y1="0" y2="1">
                 <stop offset="0" stop-color="#8da4ff"/><stop offset="1" stop-color="#22c55e"/>
               </linearGradient>
             </defs>
             <rect x="0" y="0" width="100" height="100" fill="url(#g)"/>
             <circle cx="35" cy="50" r="10" fill="#fff" opacity=".92"/>
             <rect x="52" y="44" width="25" height="12" rx="6" fill="#fff" opacity=".92"/>
           </svg>`;

      root.innerHTML = `
        <div class="sf__imgwrap">
          <button class="sf__x" type="button" aria-label="Close" data-close>✕</button>
          ${imgBlock}
        </div>
        <button class="sf__cta" type="button" data-cta>${ctaText}</button>
      `;
      doc.body.appendChild(root);
      return root;
    }
  };

  // Экспорт и автозапуск
  win.SmartStickerFloat = API;
  if (doc.readyState === 'loading') {
    doc.addEventListener('DOMContentLoaded', () => API.init());
  } else {
    API.init();
  }
})(window, document);
